import React from 'react';
import Navbar from '@bit/reactstrap.reactstrap.navbar';
import Nav from '@bit/reactstrap.reactstrap.nav';
import NavItem from '@bit/reactstrap.reactstrap.internal.nav-item';
import NavLink from '@bit/reactstrap.reactstrap.internal.nav-link';
import UncontrolledDropdown from '@bit/reactstrap.reactstrap.uncontrolled-dropdown';
import DropdownToggle from '@bit/reactstrap.reactstrap.internal.dropdown-toggle';
import DropdownMenu from '@bit/reactstrap.reactstrap.internal.dropdown-menu';
import DropdownItem from '@bit/reactstrap.reactstrap.internal.dropdown-item';

class City extends React.Component {
  render() { 
    return (
      <div>
        <link
          rel='stylesheet'
          href='https://cdnjs.cloudflare.com/ajax/libs/twitter-bootstrap/4.1.3/css/bootstrap.min.css'
        />

        <UncontrolledDropdown setActiveFromChild>
          <DropdownToggle tag='a' className='nav-link' caret>
            Dropdown
          </DropdownToggle>
          <DropdownMenu>
            <DropdownItem tag='a' href='/blah' active>
              Link
            </DropdownItem>
          </DropdownMenu>
        </UncontrolledDropdown>
      </div>
    );
  }
}
export default City;
